import React, {Component} from 'react';

class KeyPadComponent extends Component {

    render() {
        return (
            <div className="button">
                <h1>Gender</h1>
                <button name="Female" onClick={e => this.props.onClick(e.target.name)}>Female</button>
                <button name="Male" onClick={e => this.props.onClick(e.target.name)}>Male</button><br/>


                <button name="Sedentary" onClick={e => this.props.onClick(e.target.name)}>Sedentary</button>
                <button name="Moderate" onClick={e => this.props.onClick(e.target.name)}>Moderate</button>
                <button name="Active" onClick={e => this.props.onClick(e.target.name)}>Active</button><br/>


                <button name="Lose" onClick={e => this.props.onClick(e.target.name)}>Lose</button>
                <button name="Gain" onClick={e => this.props.onClick(e.target.name)}>Gain</button>
                <button name="Maintain" onClick={e => this.props.onClick(e.target.name)}>Maintain</button><br/>


            </div>
        );
    }
}


export default KeyPadComponent;
